Still pinching myself after a weekend full of cowgirl magic celebrating #Cowgirl30Under30 with @cowgirlmagazine.

I met some of the most inspiring women from all across the country defining what it means to be a cowgirl in their own unique way.

Little Kiah, the girl who didn’t think she was “cowgirl” enough to even fit in with her family, would be so dang proud to see that she belonged all along.

To my fellow honorees, I can’t wait to what mountains you continue to climb.

To our sponsors, thank you for elevating women in the western industry.

And to my mom, thank you for believing in me long before I knew how to believe in myself. I couldn’t have asked for a better date to cherish this unforgettable weekend with.

